        if (items) {
          for (let item of items) {
            let arr = item.split(":");
            let cardId = arr[0],
                points = arr[1];
            cardPointsMap[cardId] = points;
          }
        }
        this.cardPointsList = [];
        for (let c of this.cardList) {
          this.cardPointsList.push({
            cardId: c.cardId,
            cardName: c.cardName,
            points: cardPointsMap[c.cardId]
          });
        }
